function FileList() {
	return (
		<Container>
			<li>
				<FileInfo>
					<Preview src='https://uploadteste10.s3-sa-east-1.amazonaws.com/3329bce3bfe62c4af954f426fe576046-Captura%20de%20tela%20de%202021-03-29%2021-22-38.png' />
					<div>
						<strong>teste.png</strong>
						<span>
							64kb{' '}
							<button
								onClick={() => {}}>
